import React, {Component} from "react";
import './App.css';

class App extends Component {
    const
    componentDidMount() {
        const apiUrl = 'http://aleksanderblaszkiewicz.pl/callendar/get_events.php';
        fetch(apiUrl).then((response) => response.json()).then((data) => console.log(data));
    }
    render() {
        return  (
            <>
                <div className="App">
                <h1>Kalendarz</h1>
                </div>
            </>
    )
  }
}

export default App;
